(function(){
  function waitForOl(callback, attempts) {
    attempts = attempts || 0;
    if(!!window.OOo && !!window.OOo.oo_floating) {
      callback();
    } else if(attempts < 10) {
      setTimeout(function() {
        waitForOl(callback, attempts+1);
      }, 250)
    }
  };
  function addCustomVarsToOLObject(oLObjectName) {
    try {
      if(!!window.OOo[oLObjectName] && !!window.OOo[oLObjectName].options) {
        window.OOo[oLObjectName].options.customVariables.qmSessionCookie = QuantumMetricAPI.getSession();
        window.OOo[oLObjectName].options.customVariables.qmReplayLink = 'https://crateandbarrel.quantummetric.com/#/users/search?qmSessionCookie='+QuantumMetricAPI.getSession()+'&ts=last_30_days&autoreplay=true';
    window.OOo[oLObjectName].options.customVariables.qmSubscriptionName = 'crateandbarrel';
      }
    } catch(e) {}
  }
  QuantumMetricAPI.addEventListener('start', function() {
    waitForOl(function() {
      try {
        addCustomVarsToOLObject('oo_floating');
      } catch(e) {}
    })
  })
})();
